import React, {Component} from 'react';
import InfiniteCarousel from 'react-leaf-carousel';

export default class extends Component{
  render(){
    return(
      <InfiniteCarousel
      breakpoints={[
        {
          breakpoint: 500,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
          },
        },
        {
          breakpoint: 768,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
          },
        },
      ]}
      dots={true}
      showSides={true}
      sidesOpacity={.5}
      sideSize={.1}
      slidesToScroll={4}
      slidesToShow={4}
      scrollOnDevice={true}
    >
      {[1,2,3,4,5,6,7].map(x => 
      <div style={{maxWidth : '75px'}}>
        <img
          alt=''
          src='https://vignette.wikia.nocookie.net/konosuba/images/1/14/Aqua-anime.png/revision/latest?cb=20180328145536'
        />
      </div>)}
    </InfiniteCarousel>
    )
  }
}
